objetoCompra:
CONTRATAÇÃO DE EMPRESA ESPECIALIZADA PARA A PRESTAÇÃO DE SERVIÇOS DE MANUTENÇÃO PREVENTIVA E CORRETIVA, COM FORNECIMENTO CONTÍNUO DE PEÇAS E INSUMOS DO EQUIPAMENTO GENEXPERT (XPERT MTB/RIF), PARA A REALIZAÇÃO DE TESTES RÁPIDOS DE TUBERCULOSE (TRM/TB), CARGA VIRAL DE HBV, HCV E HIV, POR UM PERÍODO DE 1(UM) ANO, PARA ATENDER ÀS NECESSIDADES DO CENTRO DE MEDICINA TROPICAL DO ESTADO DE RONDÔNIA (CEMETRON).

Memória de Cálculo:

O CEMETRON dispõe do equipamento GeneXpert, conforme descrito no item 5.2.1, sendo, portanto, imprescindível a realização da manutenção preventiva utilizando o kit XpertCheck. Essa manutenção ocorre uma vez por ano, durante o período contratual, e consiste na verificação do equipamento para assegurar seu pleno funcionamento. A manutenção preventiva abrange os seguintes serviços:

Mão de obra especializada;

Substituição dos módulos por meio de troca;

Fornecimento do kit XpertCheck;

Garantia de 12 meses.

Essas medidas visam garantir a eficiência e a confiabilidade do equipamento.

A presente justificativa visa embasar a necessidade da contratação de empresa especializada para a prestação de serviços de manutenção preventiva e corretiva, com fornecimento contínuo de peças e insumos do equipamento GeneXpert (XPERT MTB/RIF), utilizado para testes rápidos de tuberculose, carga viral de HBV, HCV (hepatites B e C) e HIV, por um período de 12 meses, para atender às necessidades do Centro de Medicina Tropical do Estado de Rondônia (CEMETRON).

Doado pelo Ministério da Saúde, o GeneXpert está sob responsabilidade do estado para sua manutenção. Ele realiza o Teste Rápido Molecular para Tuberculose (TRM-TB), que detecta Mycobacterium tuberculosis e resistência à rifampicina em cerca de duas horas. Essa tecnologia, aprovada pela Comissão Nacional de Incorporação de Tecnologias no SUS (Conitec) e incorporada ao SUS desde 2013, é essencial para o diagnóstico rápido e eficaz da tuberculose, permitindo intervenções terapêuticas imediatas e reduzindo a transmissão da doença.
